import React from 'react'
import '../styles/bootstrap.min.css'
import smsImage from '../img/sms.png'

export class KontenUtama extends React.Component {
    render(){
        return (
            <div className='konten-utama'>
                <img src={smsImage}/>
            </div>
        )
    }
}
